// src/App.jsx
import React, { useState, useEffect } from 'react';
import './App.css';
import BorderBox from './components/BorderBox';
import KeywordCard from './components/KeywordCard';
import TimeTable from './components/TimeTable';
import CategoryChipList from './components/CategoryChipList';
import Bookmark from './components/Bookmark';
import Graybox1 from './components/Graybox1';
import Graybox2 from './components/Graybox2';
import { starImageBase64, gifBase64, headerBase64 } from './assets/base64';

const { GoogleGenerativeAI } = require("@google/generative-ai");

const App = () => {
  const apiKey = process.env.REACT_APP_GOOGLE_GENERATIVE_AI_KEY;
  const genAI = new GoogleGenerativeAI(apiKey);
  const model = genAI.getGenerativeModel({ model: "gemini-1.5-flash" });
  const [keywordData, setKeywordData] = useState([]);
  const [topVisitedIcons, setTopVisitedIcons] = useState([]);

  const sampleData = [
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#74E792', '#74E792', '#74E792'], // Green
    ['#74E792', '#74E792', '#74E792', '#74E792', '#74E792', '#74E792'],
    ['#74E792', '#74E792', '#74E792', '#74E792', '#74E792', '#74E792'],
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#99DAFF', '#99DAFF', '#99DAFF'], // Cyan, Gray, Magenta
    ['#99DAFF', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8'], // Magenta
    ['#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8'], // Cyan
    ['#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#FFD6E8'],
    ['#FFD6E8', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#E0E0E0', '#99DAFF', '#99DAFF', '#99DAFF', '#99DAFF'],
    ['#74E792', '#99DAFF', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0', '#E0E0E0'],
    ['#E0E0E0', '#99DAFF', '#99DAFF', '#FFD6E8', '#FFD6E8', '#FFD6E8'],
    ['#99DAFF', '#FFD6E8', '#FFD6E8', '#FFD6E8', '#99DAFF', '#FFD6E8']
  ];



  useEffect(() => {
    const fetchHistory = () => {
      if (chrome && chrome.history) {
        chrome.history.search({ text: '', startTime: 0, maxResults: 20 }, async (results) => {
          const historyData = results.map(item => ({ url: item.url, title: item.title || item.url }));

          // Fetch favicons for the top 3 visited sites
          const favicons = results.slice(0, 3).map(item => {
            try {
              const urlObj = new URL(item.url);
              return `https://www.google.com/s2/favicons?sz=32&domain=${urlObj.hostname}`;
            } catch {
              return starImageBase64; // Fallback image if URL parsing fails
            }
          });

          setTopVisitedIcons(favicons);

          // Send data to Gemini API
          const prompt = `Analyze the following browser history. Based on frequency, uniqueness of the topic, and content relevance, filter out unnecessary items. Provide 5 main topics with their summary and categorize them into: 0 (Development), 1 (Lifestyle), or 2 (Entertainment).

          Data:
          ${JSON.stringify(historyData, null, 2)}

          Respond in the following JSON format:
          [
            {"title": "", "summary": "", "category": 0},
            {"title": "", "summary": "", "category": 1},
            {"title": "", "summary": "", "category": 2},
            {"title": "", "summary": "", "category": 1},
            {"title": "", "summary": "", "category": 2}
          ]`;

          try {
            const result = await model.generateContent(prompt);
            let content = result.response.text();

            // ✅ Strip code block wrappers (```json ... ```)
            content = content.replace(/```json|```/g, '').trim();

            // ✅ Now safely parse the cleaned JSON
            const processedData = JSON.parse(content);
            console.log(content);
            console.log(processedData);
            setKeywordData(processedData);
          } catch (error) {
            console.error("Error fetching data from Gemini:", error);
          }
        });
      }
    };

    fetchHistory();
  }, []);

  const containerStyle = {
    display: 'inline-flex',
    padding: '24px',
    flexDirection: 'column',
    alignItems: 'flex-start',
    gap: '10px',
    borderRadius: '5px',
    border: '1px solid var(--Accessibility-Black-in-light-themes, #000)',
    background: 'var(--Notification-success-background-color, #DEFBE6)',
    boxShadow: '0px 2px 6px 0px rgba(0, 0, 0, 0.30)',
    width: '1505px',
    height: '899px',
    position: 'absolute',
    top: '283.76px',
    left: '56.5px',
    zIndex: 1
  };

  const bookmarksContainerStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '16px',
    position: 'absolute',
    top: '323.76px',
    left: '1610px',
    zIndex: 0
  };

  const innerContainerStyle = {
    width: '1457px',
    height: '824px',
    margin: '24px',
    gap: '16px',
    display: 'flex',
    justifyContent: 'space-between'
  };

  const column1Style = {
    display: 'flex',
    flexDirection: 'column',
    gap: '16px',
  };

  const column2Style = {
    flex: 1,
  };

  const keywordContainerStyle = {
    display: 'flex',
    flexDirection: 'column',
    gap: '8px',
  };

  const titleStyle = {
    fontFamily: 'IBM Plex Sans',
    fontWeight: 600,
    fontSize: '36px',
    lineHeight: '44px',
    letterSpacing: '0px',
    color: '#000'
  };
  const topVisitedContainerStyle = {
    display: 'flex',
    justifyContent: 'center',  // 가운데 정렬
    gap: '10px',               // 원들 사이 간격
    marginTop: '10px'          // 제목과 간격 조정
  };
  
  const circleImageStyle = {
    width: '50px',             // 원 크기
    height: '50px',
    borderRadius: '50%',       // 동그랗게 만들기
    objectFit: 'cover',        // 이미지가 원을 가득 채우도록 설정
    border: '2px solid #ccc'   // 테두리 추가 (선택 사항)
  };
  const overlayTextStyle = {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    color: 'var(--Background-ui-background, #FFF)',
    textAlign: 'center',
    fontFamily: 'IBM Plex Serif',
    fontSize: '32px',
    fontStyle: 'normal',
    fontWeight: 700,
    lineHeight: '40px',
    color: 'black'
  };

  return (
    <div>
      <div
        style={{
          position: "relative", // 부모 컨테이너를 relative로 설정
          marginTop: "100px",
          marginLeft: "35px",
          display: "inline-block" // 이미지 크기에 맞게 영역 유지
        }}
      >
      {/* 헤더 이미지 위에 올라갈 텍스트 */}
      <div style={{
        position: "absolute",
        top: "50%",  // 이미지를 기준으로 중앙 배치
        left: "50%",
        width: "100%",
        transform: "translate(-50%, -50%)", // 정확한 중앙 정렬
        color: "var(--Tag-Purple-text, #6929C4)",
        textAlign: "center",
        fontFamily: "IBM Plex Serif",
        fontSize: "55px",
        fontWeight: 600,
        lineHeight: "40px",
        zIndex: 10, // 이미지보다 위로 배치
        paddingBottom: '12px'
      }}>
        Great Day, Sana!
      </div>

  {/* 헤더 이미지 */}
  <img
    src={headerBase64}
    alt="Header"
    style={{
      width: "100%", // 전체 너비로 설정 (필요에 따라 조정 가능)
      display: "block",
      zIndex: 1 // 기본적으로 뒤에 위치
    }}
  />
</div>
// App.js의 return문 내부 맨 아래에 추가
<div 
  style={{
    position: 'absolute',
    left: '1196px',
    top: '97.9px',
    zIndex: 9999, // 가장 높은 z-index
    width: 'fit-content', // 이미지 크기에 맞춤
    height: 'fit-content'
  }}
>
  <div style={{
    position: 'relative',
    width: '100%',
    height: '100%'
  }}>
    {/* Base64 이미지 (yourImageBase64 변수는 직접 추가해야 함) */}
    <img 
      src="data:image/png;base64,"
      alt="Positioned Content"
      style={{
        width: '100%', // 원하는 크기로 조정
        height: '100%',
        objectFit: 'contain'
      }}
    />
    
    {/* 추가적인 내용이 있다면 여기에 */}
  </div>
</div>

      <div style={bookmarksContainerStyle}>
        <Bookmark isActive={true} label="MAIN" />
        <Bookmark isActive={false} label="ANALYSIS" />
        <Bookmark isActive={false} label="SAVED" />
        <Bookmark isActive={false} label="SETTING" />
      </div>
      <div style={containerStyle}>
        <div style={innerContainerStyle}>
          <div style={column1Style}>
            <BorderBox>
              <div style={titleStyle}>Focus</div>
              <Graybox1
              title="Peak Duration" subtitle="0'32''" />
              <Graybox2 title="Level" imageSrc={starImageBase64} altText="level" overlayText="17" />
            </BorderBox>
            <BorderBox>
              <div style={titleStyle}>Top Visited</div>
              <div style={topVisitedContainerStyle}>
                {topVisitedIcons.map((icon, index) => (
                  <img key={index} src={icon} alt={`Visited ${index + 1}`} style={circleImageStyle} />
                ))}
              </div>
            </BorderBox>
            <img src={gifBase64} alt="Animation" style={{
              width: '100%', height: 'auto',
              borderRadius: '5px',
              border: '1px solid var(--Accessibility-Black-in-light-themes, #000)',
              background: 'var(--Background-ui-background, #FFF)'}} />
          </div>

          <div style={column2Style}>
            <BorderBox>
              <div style={
                {
                  fontFamily: 'IBM Plex Sans',
                  fontWeight: 600,
                  fontSize: '36px',
                  lineHeight: '44px',
                  letterSpacing: '0px',
                  color: '#000',
                  marginBottom: '10px'
                }
              }>
                Today's Picks
              </div>
              <div style={keywordContainerStyle}>
                {keywordData.map((item, index) => (
                  <KeywordCard
                    key={index}
                    iconText={['D', 'L', 'E'][item.category]}  // Set based on category
                    title={item.title}
                    label={`Category: ${['Development', 'Lifestyle', 'Entertainment'][item.category]}`}
                    description={item.summary}
                  />
                ))}
              </div>
            </BorderBox>
          </div>

          <div style={column2Style}>
            <BorderBox>
              <div style={titleStyle}>Time Table</div>
              <CategoryChipList />
              <TimeTable rows={6} columns={6} data={sampleData} style={{maxHeight:'100%', overflow: 'auto'}} />
            </BorderBox>
          </div>
        </div>
      </div>
    </div>
  );
};

export default App;
